import { useEffect, useState } from 'react';
import './App.css';
// import Todo from './components/todo';

function App() {
  const [todos,setTodos]=useState()

  useEffect(()=>{
    const url = 'https://jsonplaceholder.typicode.com/todos';

    fetch(url)
    .then((res)=> {
      return res.json()
    })
    .then((data)=> {
        console.log(data)
        setTodos(data)
    })
  },[]);

  return (
    <div className="container">
      {/* <Todo /> */}

            <table className='table  table-striped'>
              <thead>
               <tr>
                <th scope='col'>ID</th>
                <th scope='col'>Title</th>
                <th scope='col'>Status</th>
               </tr>
              </thead>
                {todos && todos.map((todo)=>{
                  return(
                    <tbody className='bg-dark text-light border p-3'>
                      <tr>
                        <td>{todo.id}</td>
                        <td>{todo.title}</td>
                        <td className={todo.completed? 'success' : 'danger'}>
                        {todo.completed? 'Completed' : 'Pending'}
                        </td>
                      </tr>
                    </tbody>
                  )
                })}
            </table>


    </div>
  );
}

export default App;
